(163, 'Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\r\n\r\na.\r\neindeutig erkennbare Jagd- und Sportwaffen (z. B. nach ISSF-Norm), die in derselben Ausführung nicht auch Kampfwaffen sind;\r\nb.\r\nEinzellader und Vorderlader;\r\nc.\r\nFaustfeuerwaffen und Repetiergewehre für Randfeuermunition;\r\nd.\r\nalte Waffen, für die keine verwendbare Munition mehr hergestellt wird oder im öffentlichen Handel erhältlich ist.\r\nAnmerkung: KM 1.d. erfasst auch folgende Waffen:\r\n\r\n1.\r\nMusketen, Gewehre und Karabiner, die vor 1890 hergestellt wurden, und ihre Nachbildungen;\r\n2.\r\nRevolver, Pistolen und Maschinenwaffen, die vor 1890 hergestellt wurden, und ihre Nachbildungen.\r\nKM 1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.', 'Armes individuelles à épauler et armes de poing de tout calibre, leurs accessoires et leurs composants spécialement conçus, à l\'exception des armes suivantes:\r\n\r\na.\r\narmes de chasse et armes de sport incontestablement reconnaissables (p. ex. selon les normes ISSF) qui, dans la même exécution, ne sont pas également des armes de combat;\r\nb.\r\narmes à un coup et armes se chargeant par la bouche;\r\nc.\r\narmes de poing et fusils à répétition tirant des cartouches à percussion annulaire;\r\nd.\r\narmes anciennes, pour lesquelles des munitions utilisables ne sont plus fabriquées ou ne se trouvent plus dans le commerce.\r\nNotes:\r\n\r\nLa rubrique KM 1d vise également les armes suivantes:\r\n\r\n1.\r\nmousquets, fusils et carabines fabriqués avant 1890, ainsi que leurs reproductions;\r\n2.\r\nrevolvers, pistolets et mitrailleuses fabriqués avant 1890, ainsi que leurs reproductions.\r\nNote:\r\n\r\nLes rubriques KM 1a à KM 1d visent également les armes spécialement conçues pour des munitions inertes d\'instruction, qui ne peuvent tirer aucune des munitions visées à la rubrique KM 3.', 'Armi da fuoco portatili di ogni calibro e loro accessori nonché loro componenti appositamente progettati, ad eccezione tuttavia:\r\n\r\na.\r\ndelle armi da caccia e delle armi da sport, indubbiamente riconoscibili come tali (p. es. secondo le norme ISSF), che nella stessa esecuzione non possono essere usate come armi da combattimento;\r\nb.\r\ndelle armi a colpo singolo e delle armi ad avancarica;\r\nc.\r\ndelle armi da fuoco portatili e di fucili a ripetizione a munizione a percussione periferica;\r\nd.\r\ndelle vecchie armi, per le quali non sono più fabbricate o non sono più in commercio munizioni utilizzabili.\r\nNota: Il punto KM 1.d. sottopone a autorizzazione anche le armi seguenti:\r\n\r\n1.\r\nmoschetti, fucili e carabine anteriori al 1890 e loro riproduzioni;\r\n2.\r\nrivoltelle, pistole e mitragliatrici anteriori al 1890 e loro riproduzioni.\r\nNota: I punti KM 1.a. - KM 1.d. sottopongono a autorizzazione anche armi appositamente progettate per munizioni a salve, non in grado di sparare alcuna munizione di cui al punto KM 3.', 'Hand guns and small arms of any calibre and accessories and specially designed components therefor, but not including:\r\n\r\na.\r\nClearly recognisable hunting and sports weapons (e.g. as per ISSF standard) that cannot also be used as military weapons in the same form;\r\nb.\r\nSingle-shot firearms and muzzle-loading firearms;\r\nc.\r\nSmall arms and repeating rifles for rimfire ammunition;\r\nd.\r\nAntique weapons for which usable ammunition is no longer produced or which are no longer available on the public market.\r\nNote: ML 1.d. also controls the following weapons:\r\n\r\n1.\r\nMuskets, rifles and carbines manufactured before 1890 , and their reproductions;\r\n2.\r\nRevolvers, pistols and machine guns manufactured before 1890 , and their reproductions.\r\nML 1.a. to ML 1.d. also control weapons specially designed to fire dummy ammunition, which cannot fire ammunition controlled by ML 3.'),
