(177, 'Waffen, wesentliche Waffenbestandteile, Waffenzubehör, Munition und Munitionsbestandteile nach dem WG, die nicht der Kriegsmaterialgesetzgebung unterliegen und von Anhang 3 nicht erfasst werden. Ausgenommen sind im nichtgewerbsmässigen Verkehr Messer und Dolche nach Artikel 7 der Waffenverordnung vom 2. Juli 2008.', 'Les armes, les éléments essentiels d\'armes, les accessoires d\'armes, les munitions et les éléments de munitions au sens de la LArm qui ne sont pas soumis à la législation sur le matériel de guerre ni visés à l\'annexe 3. Sont exemptés du trafic à titre non professionnel les couteaux et les poignards selon l\'art. 7 de l\'ordonnance du 2 juillet 2008 sur les armes.', 'Armi, parti essenziali di armi, accessori di armi, munizioni ed elementi di munizioni conformemente alla LArm che non sono soggetti alla legislazione sul materiale bellico e neppure all\'allegato 3 della presente ordinanza. Fanno eccezione, nel commercio non professionale, coltelli e pugnali conformemente all\'articolo 7 dell\'ordinanza del 2 luglio 2008 sulle armi.', 'Weapons, essential weapons parts and components, weapons accessories, ammunition or ammunition parts and components in terms of the WA that are not subject to the legislation on war material and are not included in Annex 3. Exempted from the foregoing are knives and daggers in terms of Article 7 of the Weapons Ordinance of 2 July 2008 that are in non-commercial circulation.'),
(178, 'Sprengmittel und Schiesspulver nach dem Sprengstoffgesetz vom 25. März 1977, die nicht der Kriegsmaterialgesetzgebung unterliegen und nicht von den Anhängen 2 und 3 erfasst werden.', 'Les matières explosives et la poudre de guerre au sens de la loi du 25 mars 1977 sur les explosifs qui ne sont pas soumises à la législation sur le matériel de guerre ni visées aux annexes 2 et 3.', 'Esplosivi e polvere esplosiva conformemente alla legge federale del 25 marzo 1977 sugli esplosivi che non sono soggetti alla legislazione sul materiale bellico e agli allegati 2 e 3 della presente ordinanza.', 'Explosives and propellant powder under the Explosives Act of 25 March 1977 that are not subject to the legislation on war material and are not included in Annexes 2 and 3.'),
